import React from 'react';

import './TodoList.css';
import Todo from '../Todo/Todo';

const dummyTodos = [
    { name: "Go to the market" },
    { name: "Go to the market" },
    { name: "Go to the market" }]

const TodoList = () => {
    return (
        <div className='todolist'>
            <div className='heading'>Things todo</div>
            { dummyTodos.map(name => <Todo name={name}/>) }
        </div>
    );

}

export default TodoList;
